import React, { useState,useEffect } from 'react';
import Table from 'react-bootstrap/Table';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { Link } from 'react-router-dom';
import Form from 'react-bootstrap/Form';

const RetriveEmployee = () => {

    const[data, setDate] = useState([]);
  
    //save data in list
       function getdata(){
           axios.get('http://localhost:8080/getemployee')
           .then((res)=>{
               console.log(res.data);   //data is array added object
               setDate(res.data);
           });
       }

       useEffect(()=>{ // useEffect use to rerander only when change in getdata function
        getdata();
    },[]); 
   
  return (
    <div>
      <Form>
       <Form.Check // prettier-ignore
         type="switch"
         id="custom-switch"
         label="Check this switch"
       />
     </Form>
  
          <div className="d-flex justify-content-between m-3">
      
         <h2>Read Operation</h2>
         <Link to = "/CreateEmployee">
         <Button variant="secondary">Create New</Button>
         </Link>
         </div>
         <h1>Read empoyee</h1>
       <Table striped bordered hover>
       <thead>
         <tr>
           <th>pkEmpId</th>
           <th>emailId </th>
           <th>passwd</th>
           <th>Action</th>
           <th></th>
         </tr>
       </thead>
       <tbody >
       {
         data.map((eachdata)=>{
             return(
             <tr>
              <td>{eachdata.pkEmpId}</td>
             <td>{eachdata.emailId}</td>
             <td>{eachdata.passwd}</td>
             <td>
             <Button variant="primary">view</Button>
             <Button variant="outline-primary">Primary</Button>
             <Button variant="danger">Delete</Button>
             </td>
              </tr>
                )})
       }
       </tbody>
     </Table>
     </div>
  )
}

export default RetriveEmployee
